    if (shapeType == 2) return sdCone(p, innerSize, u_orientation) - radius;
    if (shapeType == 3) return sdTorus(p, innerSize, u_orientation) - radius;
    if (shapeType == 4) return sdCapsule(p, innerSize, u_orientation) - radius;
